        uint256 integer_part;
        if (x >= 2**128) {
            x >>= 128;
            integer_part += 128;
        }
        if (x >= 2**64) {
            x >>= 64;
            integer_part += 64;
        }
        if (x >= 2**32) {
            x >>= 32;
            integer_part += 32;
        }
        if (x >= 2**16) {
            x >>= 16;
            integer_part += 16;
        }
        if (x >= 2**8) {
            x >>= 8;
            integer_part += 8;
        }
        if (x >= 2**4) {
            x >>= 4;
            integer_part += 4;
        }
        if (x >= 2**2) {
            x >>= 2;
            integer_part += 2;
        }
        if (x >= 2**1) {
            /* x >>= 1; */
            integer_part += 1;
        }
        integer_part *= e_decimals;

        x = operand / (2**(integer_part / e_decimals));
        // 1 <= x < 2
        uint256 fractional_part;
        // log(x) = (1/2)*log(x^2)
        // log(x) = 1 + log(x/2)
        for (uint256 delta = e_decimals; delta > 0; delta /= 2) {
            // if x >= 2, use second identity, and halve
            if (x >= 2 * e_decimals) {
                fractional_part += delta;
                x /= 2;
            }
            // x < 2, use first identity
            x = (x * x) / e_decimals;
        }
        return fractional_part + integer_part;
    }

